const CartDetail = () => {
    return (
        <>
            <div
                style={{
                    height: '70px',
                    border: '1px solid red',
                    paddingLeft: '20px',
                    paddingRight: '20px',
                }}
            >
                Flipkart
            </div>
        </>
    );
};

export default CartDetail;
